import React, { useState } from 'react'

const ProfileStatus = () => {
    const [status, setStatus] = useState('status')
    const inputHandler = (e) => {
        setStatus(e.current.value)
    }
    return (
        <div>
            <span>status</span>
            <input onChange={inputHandler} value={status}/>
        </div>
    )
}

export default ProfileStatus
